script: |
  super -f text -I q8330.spq | sort > q8330.out

inputs:
  - name: q8330.spq
    data: |
      SELECT CAST ( - col1 AS INTEGER ) FROM tab0 (FORMAT parquet) AS cor0 WHERE - + col1 + - ( + - col1 ) + + + col1 * 45 IN ( + col1, ( - col2 ) ) AND NOT + col2 * col2 + + col1 / col1 IS NOT NULL;
  - name: tab0

outputs:
  - name: q8330.out
    data: |
